import React from 'react';
import './ProgressBar.scss';
import { CircularProgressbar } from "react-circular-progressbar";
import "react-circular-progressbar/dist/styles.css"

function Progress() {

  return (
    <div className="ProgressBar">
      <div className='top'>
        <div className="title">
          <h2>Customers</h2>
        </div>
        <p>Customers that buy products</p>
      </div>
      <div className='bottom'>
        <div className='pb'>
          <div className='progress-container' style={{ position: 'relative' }}>
            <CircularProgressbar value={65} text="65%" styles={{ text: { fontSize: '16px' } }} />
            <p style={{ fontSize: '12px', position: 'absolute', top: '70%', left: '70%', transform: 'translate(-50%, -50%)' }}>Total New Customers</p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Progress;
